const initialFriends = [
  {
    id: 118836,
    name: "Clark",
    image: "https://i.pravatar.cc/48?u=118836",
    balance: -7,
  },
  {
    id: 933372,
    name: "Sarah",
    image: "https://i.pravatar.cc/48?u=933372",
    balance: 20,
  },
  {
    id: 499476,
    name: "Anthony",
    image: "https://i.pravatar.cc/48?u=499476",
    balance: 0,
  },
];

export default function App() {
  return (
    <div>
      <FriendsList />;<h2>Core Concepts</h2>
      <ul>
        <CoreConcept
          title="Components"
          description="The core of building
        block."
        />
        <CoreConcept title="React" description="A JavaScript Library." />
        <CoreConcept title="Java" description="A programming language." />
      </ul>
    </div>
  );
}

function CoreConcept({ title, description }) {
  return (
    <li>
      <h3>{title}</h3>
      <p>{description}</p>
    </li>
  );
}
function FriendsList() {
  const friends = initialFriends;
  return (
    <div>
      {friends.map(({ id, name, image, balance }) => (
        <Friend name={name} image={image} balance={balance} key={id} />
      ))}
    </div>
  );
}

function Friend({ name, image, balance }) {
  return (
    <div>
      <h3>{name}</h3>
      <img src={image} alt={name} />
      <span>{balance}</span>
    </div>
  );
}
